var bgImg;var overflowBody;var minWidth;var icoLogo;var bgColor;var btnFecharAlt=true;var btnEsc=true;var msgAt=0;var btn_fechar="";var ico_ale="";var ico_err="";var ico_inf="";var ico_per="";var ico_bgf="data:image/png;base64,";var ico_mini="data:image/png;base64,";function msg(){};msg.setBgImg=function(vBgImg){bgImg=vBgImg};msg.setOverflowBody=function(vOverflowBody){overflowBody=vOverflowBody};msg.setMinWidth=function(vMinWidth){minWidth=vMinWidth};msg.setIcoLogo=function(vIcoLogo){icoLogo=vIcoLogo};msg.setBgColor=function(vBgColor){bgColor=vBgColor};msg.setFecharAlt=function(vFecharAlt){btnFecharAlt=vFecharAlt};msg.setEsc=function(vEsc){btnEsc=vEsc};msg.getBgImg=function(){return(bgImg==undefined?ico_bgf:bgImg)};msg.getOverflowBody=function(){return(overflowBody==undefined?"hidden":overflowBody)};msg.getMinWidth=function(){return(minWidth==undefined?"300px":minWidth)};msg.getIcoLogo=function(){return(icoLogo==undefined?ico_mini:icoLogo)};msg.getBgColor=function(){return(bgColor==undefined?"#FFF":bgColor)};msg.getEsc=function(){return(btnEsc==undefined?true:btnEsc)};msg.exibe=function(titulo,mensagem,botoes,focu,alerta,largura,fechar){msgAt+=1;fechar=(fechar!=""&&fechar!=undefined?fechar:"msg.oculta()");largura=(largura!=""&&largura!=undefined?largura:"300px");window.scrollTo(0,0);$("body").css("overflow",msg.getOverflowBody());var newMessenger="<div id='dvmensagem"+msgAt+"' style='background-image:url("+msg.getBgImg()+"); background-repeat:repeat; position:absolute; margin:0 auto; background-color:transparent;'>";newMessenger+=(!btnFecharAlt?"":"<div id='fechaFundo' style='background-color:#000; color:#FFF; width:50px; text-align: center; position: absolute; top:0; left:0; border-radius: 6px; font-size: 12px; border: 2px ridge #000; cursor: pointer;' onclick=\"javaScript:"+fechar+"\"><b>FECHAR</b></div>");tipoAlerta=(alerta=="alerta"?ico_ale:(alerta=="erro"?ico_err:(alerta=="pergunta"?ico_per:ico_inf)));newMessenger+="<div id='msg_tabela_exibe"+msgAt+"' style='min-width:"+msg.getMinWidth()+"; max-width:"+largura+"; width:"+largura+"; height: auto; border: 1px solid #000; background-color:"+msg.getBgColor()+"; border-radius: 10px; overflow: hidden; text-align: center; box-shadow: 1px 1px 2px #2D2929'>";newMessenger+="<table border='0' cellspacing='0' style='width:100%;'>";newMessenger+="<tr>";newMessenger+="<td style='background-color: #000; height: auto; width: 20px; border-bottom: 1px solid #BC8F8F;'><img src='"+msg.getIcoLogo()+"'></img></td>";newMessenger+="<td style='background-color: #000; color: #FFF; border-bottom: 1px solid #BC8F8F;'><b>"+titulo+"</b></td>";newMessenger+="<td style='background-color: #000; border-bottom: 1px solid #BC8F8F;' align='right'><img src='data:image/png;base64,"+btn_fechar+"' onclick=\""+fechar+"\" style='margin-right: 10px; cursor: pointer;'></img></td>";newMessenger+="</tr>";newMessenger+="<tr>";newMessenger+="<td><img src='data:image/png;base64,"+tipoAlerta+"' width='32px' style='padding-left: 10px'></td>";newMessenger+="<td style='text-align: left; height:60px; padding: 20px;' >"+mensagem+"</td>";newMessenger+="</tr>";newMessenger+="<tr>";newMessenger+="<td style='padding-bottom: 20px;' colspan=3>";if(botoes!=undefined&&botoes!=""){for(var i=0;i<botoes.length;i++){newMessenger+="<input id='btn"+(i+1)+"_msg' style='margin-right: 50px;' class='botao' type='Button' value='"+botoes[i][0]+"' onclick=\"javascript:"+botoes[i][1]+"\">"}}else{newMessenger+="<input id='btn1_msg' style='margin-right: 50px;' class='botao' type='Button' value='OK' onclick=\"javascript:msg.oculta()\">"};newMessenger+="</td>";newMessenger+="</tr>";newMessenger+="</table>";newMessenger+="</div></div>";$("body").append(newMessenger);$("#dvmensagem"+msgAt).css("overflow","hidden");$("#dvmensagem"+msgAt).css("width",(document.documentElement.clientWidth)+"px");$("#dvmensagem"+msgAt).css("top","0");$("#dvmensagem"+msgAt).css("left","0");$("#dvmensagem"+msgAt).css("min-height",(parseInt($("body").css("height").toString().split("px").join(""))>document.documentElement.clientHeight?$("body").css("height"):document.documentElement.clientHeight));$("#dvmensagem"+msgAt).css("height","auto");$('#msg_tabela_exibe'+msgAt).css("display","none");TweenMax.to($('#msg_tabela_exibe'+msgAt),0.2,{css:{margin:"50px auto",display:"block"},delay:0.5,ease:Elastic.easeOut,onComplete:atribuiFocu,onCompleteParams:[focu]});TweenMax.to($("#dvmensagem"+msgAt),0,{css:{scale:0,display:"none"}});TweenMax.to($("#dvmensagem"+msgAt),0.3,{css:{scale:1,display:"block"}});$("#dvmensagem"+msgAt).css("z-index",100000);var btnF=new Function(fechar);$("#dvmensagem"+msgAt).live('keyup',function(event){if(event.which==27){if(msg.getEsc()){btnF()}}})};msg.oculta=function(){$("#dvmensagem"+msgAt).remove();msgAt-=1;if(msgAt<=0){$("body").css("overflow",(msg.getOverflowBody()=="hidden"?"visible":"auto"))}else{atribuiFocu(1)}};function atribuiFocu(id_btn){id_btn=(id_btn!=""&&id_btn!=undefined?id_btn:1);$("#dvmensagem"+msgAt+" #btn"+id_btn+"_msg").focus()};
